import {createStore} from "redux";
import reducer from "./reducer";


// Build the middleware for intercepting and dispatching navigation actions

const initialState = {
    reports: [
        {
            name: 'Acquired Users',
            amount: '13,460',
            type: 'NUMBERS',
            background: '#f0f0bf',
            color: '#fefe99'
        },
        {
            name: 'ROI',
            amount: '40',
            type: 'PERCENTAGE',
            background: '#bcd8ff',
            color: '#004bb4'
        },
        {
            name: 'Product Subscribers ',
            amount: '15000',
            type: 'NUMBERS',
            background: '#cfffd4f2',
            color: '#41e250'
        },
        {
            name: 'Communications Open Rate',
            amount: '76',
            type: 'PERCENTAGE',
            background: '#f0f0bf',
            color: '#41e250'
        }
    ],
    campaign: {}
}

const store = createStore(reducer, initialState);
export default store;
